import React from "react";

function Movie(props){
    console.log(props.title);
    return (
      <div className="term">
      
       <img className="image" src={props.poster} height="450" width="300"/>
     

      <dt>
      <h1>{props.title}</h1>
      <h2>{props.genre}</h2>
      <form action="/" method="post">
      <button type="button" class="bt">Book Now</button>
      </form>
      </dt>
      
      
    </div>
    );
}


export default Movie;
